package io.syndesis.connector.calendar;

public class GoogleCalendarEventModel {

    String title;
    String description;
    String attendees;
    String startDate;
    String startTime;
    String endDate;
    String endTime;
    String location;
    String eventId;

    public String getTitle() {
        return title;
    }

    public void setTitle(String title) {
        this.title = title;
    }

    public String getDescription() {
        return description;
    }

    public void setDescription(String description) {
        this.description = description;
    }

    public String getAttendees() {
        return attendees;
    }

    public void setAttendees(String attendees) {
        this.attendees = attendees;
    }

    public String getStartDate() {
        return startDate;
    }

    public void setStartDate(String startDate) {
        this.startDate = startDate;
    }

    public String getStartTime() {
        return startTime;
    }

    public void setStartTime(String startTime) {
        this.startTime = startTime;
    }

    public String getEndDate() {
        return endDate;
    }

    public void setEndDate(String endDate) {
        this.endDate = endDate;
    }

    public String getEndTime() {
        return endTime;
    }

    public void setEndTime(String endTime) {
        this.endTime = endTime;
    }

    public String getLocation() {
        return location;
    }

    public void setLocation(String location) {
        this.location = location;
    }

    public String getEventId() {
        return eventId;
    }

    public void setEventId(String eventId) {
        this.eventId = eventId;
    }

    @Override
    public String toString() {
        return "GoogleCalendarEventModel [title=" + title + ", description=" + description + ", attendees=" + attendees + ", startDate=" + startDate + ", startTime=" + startTime
               + ", endDate=" + endDate + ", endTime=" + endTime + ", location=" + location + ", eventId=" + eventId + "]";
    }
}
